// src/components/Header.js

import React from "react";
import { Link } from "react-router-dom"; // Import Link for navigation

const Header = () => {
  return (
    <header className="bg-green-600 p-4 text-white flex justify-center items-center">
      {/* Website Logo */}
      <h1 className="text-3xl font-bold mr-8">Green Future</h1>

      {/* Navigation Links */}
      <nav className="space-x-6 flex">
        <Link to="/about" className="font-bold hover:text-gray-200">
          About Us
        </Link>
        <Link to="/contact" className="font-bold hover:text-gray-200">
          Contact Us
        </Link>
        <Link to="/submit-idea" className="font-bold hover:text-gray-200">
          Idea Submission
        </Link>
      </nav>
    </header>
  );
};

export default Header;
